import ScrollAnim from 'rc-scroll-anim';
import React from 'react';
import ReactDOM from 'react-dom';
import QueueAnim from 'rc-queue-anim';
import TweenOne from 'rc-tween-one';
import { link } from 'fs';
// import Menu from './components/ui/Menu';

const Link = ScrollAnim.Link;
const Element = ScrollAnim.Element;
const ScrollOverPack = ScrollAnim.OverPack;
const EventListener = ScrollAnim.Event;


function Menu(props) {
    // const classe = this.dom.className;
    const lista = (
      <div>
      {props.count.map((number) =>
        <Link className={number.classe} to={number.to} showHeightActive={['50%', '10%']}>{number.text}</Link>
      )}
      </div>
    );

    return (
      <div className="nav-wap">
        {lista}
      </div>
    );
}


const count = [
  {id: 0, to: 'page0', classe: 'nav-list logo', text: '001'},
  {id: 1, to: 'page1', classe: 'nav-list', text: '002'},
  {id: 2, to: 'page2', classe: 'nav-list', text: '003'}
];

export default Menu;
